CREATE TABLE employee (
    employee_id INT PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    bank_id INT,
    position position_enum NOT NULL,
    branch_address VARCHAR(255),
    email_id VARCHAR(100),
    mobile_no VARCHAR(20)
);
